Rules.InvariantScript:
ResetForm(Form1);
Set(
    VarActivateAddAssay,
    false
);
Set(
    VarActivateAddWFS,
    false
);
Set(
    flagcreate,
    true
);
Set(
    VarModeForm,
    FormMode.New
);
Clear(Colect_Ensayos);
Clear(Colect_wfs);
Set(
    flagvisibleNumPanther,
    false
);
Set(
    flagvisibleProposal,
    false
);Set(RecordProject,Blank());
Navigate(
    'Form for NAT',
    Transition.Pop
)

ResetForm(Form1);
Set(
    VarActivateAddAssay,
    false
);
Set(
    VarActivateAddWFS,
    false
);
Set(
    flagcreate,
    true
);
Set(
    VarModeForm,
    FormMode.New
);
Clear(Colect_Ensayos);
Clear(Colect_wfs);
Set(
    flagvisibleNumPanther,
    false
);
Set(
    flagvisibleProposal,
    false
);Set(RecordProject,Blank());
Navigate(
    'Form for NAT',
    Transition.Pop
)

UpdateContext({varLoadingHome: true});
Concurrent(
    ResetForm(Form1),
    Set(
        RecordProject,
        Gallery1.Selected
    ),
    If(
        Gallery1.Selected.'Type of Analysis'.Value = "Standard Grifols solution" || Gallery1.Selected.'Type of Analysis'.Value = "Comparison between Grifols proposals",
        Set(
            VarActivateAddAssay,
            true
        ),
        Set(
            VarActivateAddAssay,
            false
        )
    ),
    If(
        Gallery1.Selected.'Type of Analysis'.Value = "Workflow simulation in batch mode (this will include STAT donations)",
        Set(
            VarActivateAddWFS,
            true
        ),
        Set(
            VarActivateAddWFS,
            false
        )
    ),
    ClearCollect(
        TempCollection,
        'DX-SALES NAT Workflow Tool | List Scenario'
    ),
    Set(
        RegistroIDgal,
        Gallery1.Selected.ID
    ),
    ClearCollect(
        Colect_Ensayos,
        Filter(
            'DX-SALES NAT Workflow Tool | List Assays',
            'Sales ID' = Gallery1.Selected.ID
        )
    ),
    ClearCollect(
        Colect_wfs,
        Filter(
            'DX-SALES NAT Workflow Tool | List Workflow Simulation',
            'Sales ID' = Gallery1.Selected.ID && Escenario = "Scenario 0"
        )
    ),
    Set(
        VarModeForm,
        FormMode.Edit
    ),
    Set(
        flagvisibleNumPanther,
        false
    ),
    Set(
        flagvisibleProposal,
        false
    ),
    Set(
        flagcreate,
        false
    )
);
Select(Parent);
Navigate(
    'Form for NAT',
    Transition.Pop
);
UpdateContext({varLoadingHome: false});

Remove(
    'DX-SALES NAT Workflow Tool | List Sales',
    ThisItem
);
RemoveIf(
    'DX-SALES NAT Workflow Tool | List Assays',
    'Sales ID' = ThisItem.ID
);
RemoveIf(
    'DX-SALES NAT Workflow Tool | List Scenario',
    'Sales ID' = ThisItem.ID
);
RemoveIf(
    'DX-SALES NAT Workflow Tool | List Workflow Simulation',
    'Sales ID' = ThisItem.ID
)
